import './App.css';
import logo from './logo.png';
import homeScreen from './homeScreen.jpg'
import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';


export function HomePage() {



const Image = () => {
    return (
      <div className="main-container">
        <div className="image-container" >
          <img src={homeScreen} alt="Commercial Services" />
          <div className="image-overlay">
            <h1>Commercial Services</h1>
          </div>
        </div>
      </div>
    );
  }


  const Footer = () => {
        return (
          <footer className="footer">
            <Container>
              <Row>
                <Col md={3} sm={6}>
                  <h5>All About Parking</h5>
                  <p><i className="fas fa-phone"></i> 650-508-8886</p>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Services</h5>
                  <ul>
                    <li>Valet Parking</li>
                    <li>Commercial Services</li>
                    <li>Airport Valet Parking</li>
                    {/* Add more services as needed */}
                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Company</h5>
                  <ul>
                    <li>Employment</li>
                    <li>Partners</li>
                    <li>About Us</li>
                    <li>Contact Us</li>
                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Locations</h5>
                  <ul>
                    <li>Menlo Park Valet Parking Services</li>
                    <li>Palo Alto Valet Parking Services</li>
                    {/* Add more locations as needed */}
                  </ul>
                </Col>
              </Row>
            </Container>
          </footer>
        );
      }




return (

    <div>

     <nav className="navbar">
       <div className="logo">
         <img className="h-10 mr-3" style={{ width: '150px', height: '150px', padding: '5px' }} src={logo} alt="Logo" />
       </div>
       <ul className="nav-links">
         <li><a href="#valet-parking">Valet Parking</a></li>
         <li><a href="#commercial-services">Commercial Services</a></li>
         <li><a href="#locations">Locations</a></li>
         <li><a href="#careers">Careers</a></li>
         <li><a href="#about">About</a></li>
         <li><a href="ContactPage">Contact</a></li>
       </ul>
       <button className="quote-btn" style={{marginLeft:'1050px', padding:'20px', color:'black', fontSize:'20px'}}>Request a Quote</button>

     </nav>
     <div style={{padding:'200px'}}>
       {Image()}
         </div>
         <div style={{padding:'200px'}}>
       {Footer()}
         </div>
       </div> 


   );





}
export default HomePage;
